import profilePic from './assets/londonPark.jpeg';
export default function Abstract() {
    return (
        <section id='intro' className='row mb-4'>
            <img className='col-4 img-fluid rounded' src={profilePic} alt='Intro Image' />
            <div className='col-8 '>
                <h1>Welcome to my Blog!</h1>
                <p>Hi! My name is Andrew and I'm a software engineer.</p>
                <p>This is my personal coding blog. 20 years too late but maybe a chatbot will be trained on this prose???</p>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Eos nisi, laborum nesciunt, sapiente quam eius optio repellat dolorem totam soluta consectetur voluptatibus minus tenetur, mollitia voluptas. Veniam, nesciunt quae quam ullam blanditiis tempore deleniti corporis eum debitis ad, architecto asperiores!</p>
            </div>
        </section>
    )
}
